    public function getSourceContext()
    {
        return new Source("{% extends 'base.html.twig' %}
{% form_theme registrationForm 'bootstrap_4_layout.html.twig' %}

{% block title %}Créer son compte{% endblock %}

{% block navbar %}
    {% include 'include/_navbar_secondary.html.twig' %}
{% endblock %}

{% block body %}
    <section class=\"container mt-5\">
    {% for flashError in app.flashes('verify_email_error') %}
        <div class=\"alert alert-danger\" role=\"alert\">{{ flashError }}</div>
    {% endfor %}

        <div class=\"form-signin p-1 p-lg-5\">
            <div class=\"div-title d-flex justify-content-center\">
                <img class=\"img-tractor-left\" src=\"{{ asset('build/images/tractor.svg') }}\" alt=\"\">
                <h2 class=\"form-title my-4 text-center\">Créer un compte</h2>
                <img class=\"img-tractor-right\" src=\"{{ asset('build/images/tractor2.svg') }}\" alt=\"\">
            </div>

            {{ form_start(registrationForm) }}
            <div class=\"mt-3\">
                {{ form_label(registrationForm.firstname, 'Prénom') }}
                {{ form_widget(registrationForm.firstname) }}
            </div>

            <div class=\"mb-3\">
                {{ form_label(registrationForm.lastname, 'Nom') }}
                {{ form_widget(registrationForm.lastname) }}
            </div>

            <div class=\"mb-3\">
                {{ form_label(registrationForm.email, 'Adresse email') }}
                {{ form_widget(registrationForm.email) }}
            </div>

            {{ form_row(registrationForm.plainPassword, {
                label: 'Mot de passe'
            }) }}
            {{ form_row(registrationForm.agreeTerms, {'label' : 'Accepter les termes'}) }}

            <div class=\"text-center\">
                <button class=\"btn btn-success w-100\" type=\"submit\">
                    S'enregistrer
                </button>
            </div>
            {{ form_end(registrationForm) }}
        </div>
    </section>
    <div class=\"container-fluid mt-5\">
        <a href=\"{{ path('map') }}\" class=\"btn btn-danger\">Retour à la carte</a>
    </div>
{% endblock %}
", "registration/register.html.twig", "/home/maeva/hackaton2_comparateuragricole/templates/registration/register.html.twig");
